svg.script:
//Listen for hover
document.querySelector('.trashcan').addEventListener('mouseover', openTrash);
document.querySelector('.trashcan').addEventListener('mouseleave', closeTrash);

function openTrash(e){

	document.querySelector('#lid-layer').style.transform = 'translate(-0.5px, 0.2px) rotate(-10deg)';
	document.querySelector('.trashcan').style.fill = '#545454';
}

function closeTrash(e){
	document.getElementById('lid-layer').style.transform = 'rotate(0deg) translateX(0px)';
	document.querySelector('.trashcan').style.fill = '#9B9C9D';
}
